import "./Storage.sol";


contract Dog is Storage {
    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    constructor() {
        owner = msg.sender;
    }

   function getNumberOfDogs() public view  returns (uint256){
    return _uintStorage["Dogs"];
   }

   function setNumberOfDogs(uint256 toSet)public {
    _uintStorage["Dogs"]=toSet;
   }

}

